webpackJsonp([0xb6935979e111],{1361:function(a,e){a.exports={data:{markdownRemark:{html:"<p>家の形を記入することは非常に複雑です。それから、非常に複雑な日本財団の書式を記入してください。現在の形はとても複雑なので、最後に「アンチ・テーブルズム」という記事を書いた。現代社会は多分形社会であり、米国には多くの形があり、それらははるかに発展している。日本の形は最も複雑であり、日本人の特徴でもある。前回私が神戸大学の客員教授に就いた時、私は中学校を卒業したときに私は尋ねる必要があります。高校を卒業したのはいつですか？どちらの月ですか？その日は何ですか？うわー、彼らとの関係は何ですか、私は訪問学者です。関係は何ですか？最後に、私は行かないことに決めました、これを立てることはできません。</p>",id:"/home/swain/workspace/political-life/src/pages/ja/0009.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ja/0009.md",frontmatter:{title:"1月12日 水曜日"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ja/0009.md absPath of file >>> MarkdownRemark"}}}});
